            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">id</th>
                <th scope="col">username</th>
                <th scope="col">email</th>
                <th scope="col">IS_STAFF</th>
                <th scope="col">IS_SUPERUSER</th>
                <th scope="col">ACTION</th>
              </tr>
            </thead>
            <tbody>
              {movies.map((movie, index) => (
                <tr key={movie._id}>
                  <th scope="row">{index + 1}</th>
                  <td>{USERSDATA.id}</td>
                  <td>{USERSDATA.username}</td>
                  <td>{USERSDATA.email}</td>
                  <td>{USERSDATA.is_staff}</td>
                  <td>{USERSDATA.is_superuser}</td>
                  <td>
                    <Button variant="outline-success" onClick={handleAddMovie}>UPDATE USERINFO </Button>
                    <Button variant="outline-danger" onClick={() => { handleDeleteMovie(movie.title); }}>DELETE USER</Button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <>
          <h2>
            You are not authorized to use. You have to be a registered Admin and logged-in.
          </h2>
          <LinkContainer to="/Admin">
            <Nav.Link className="navbar-link active">
              <h5> Click Here To Login </h5>
            </Nav.Link>
          </LinkContainer>
        </>
      )}


      <Footer />
    </div>
  );
}

export default MyList;
